import React, {useState,useEffect} from 'react';
import { StyleSheet } from 'react-native';
import VjezbeLista from '../components/VjezbeLista'
import vjezbeServer from '../src/services/vjezbe'

const VjezbeFavoriti = (props) => {
  const dioTijela=props.navigation.getParam('katNaziv')
  
  const [vjezbe, postaviVjezbe]=useState([])
  useEffect( ()=>{
    console.log("effect hook");
    vjezbeServer.dohvatiSve().then((response) => {
      console.log("Podaci ucitani");
      postaviVjezbe(response.data)
    })
  })

  const favorit=vjezbe.filter(rec => rec.kategorija==="CHEST")
  
  return (
    <VjezbeLista 
   listaPodaci={favorit}
   navigation= {props.navigation} />
  );
}

const stil = StyleSheet.create({
  ekran: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
});

export default VjezbeFavoriti
